import React from 'react';

const AdministratorHomepage = () => {
    return (
        <div className='welcomeAdminPage'>
            <div className='sideMenu'>
                <ul className='menuOnSidebar'>
                    <li>จัดการบัญชีผู้ใช้งาน</li>
                    <li>ยืนยันการมีหน้าร้าน</li>
                    <li>การรายงาน</li>
                </ul>
                <div className='imageOnSidebar'>
                    <img src="../src/images/logo.png" alt="" />
                </div>
            </div>
            <div className='picAdminPage'>

            </div>
        </div>
    );
}

export default AdministratorHomepage;
